import "./Display.css";

const Display = (props) => {
    return (
        <div className="display">
            <h1>{props.result}</h1>
            <div style={{display:"inline-block"}}>
                <span style={{width:"30%"}}>Input</span>
                <p style={{textAlign: "right",width:"70%", display:"block"}}>0</p>
            </div>
        </div>
    );
}

export default Display;
